package site.nicezo.dto;

public class Hole {
	private int holeId;
	private String holeCourseName;
	private int holeNo;
	private int holeBlue;
	private int holeWhite;
	private int holeGold;
	private int holeRed;
	private int holePar;
	private int holeHdcp;
	private String holePicture;
	private int holeState;
	private String holeDetail;
	
	public Hole() {
		// TODO Auto-generated constructor stub
	}

	public int getHoleId() {
		return holeId;
	}

	public void setHoleId(int holeId) {
		this.holeId = holeId;
	}

	public String getHoleCourseName() {
		return holeCourseName;
	}

	public void setHoleCourseName(String holeCourseName) {
		this.holeCourseName = holeCourseName;
	}

	public int getHoleNo() {
		return holeNo;
	}

	public void setHoleNo(int holeNo) {
		this.holeNo = holeNo;
	}

	public int getHoleBlue() {
		return holeBlue;
	}

	public void setHoleBlue(int holeBlue) {
		this.holeBlue = holeBlue;
	}

	public int getHoleWhite() {
		return holeWhite;
	}

	public void setHoleWhite(int holeWhite) {
		this.holeWhite = holeWhite;
	}

	public int getHoleGold() {
		return holeGold;
	}

	public void setHoleGold(int holeGold) {
		this.holeGold = holeGold;
	}

	public int getHoleRed() {
		return holeRed;
	}

	public void setHoleRed(int holeRed) {
		this.holeRed = holeRed;
	}

	public int getHolePar() {
		return holePar;
	}

	public void setHolePar(int holePar) {
		this.holePar = holePar;
	}

	public int getHoleHdcp() {
		return holeHdcp;
	}

	public void setHoleHdcp(int holeHdcp) {
		this.holeHdcp = holeHdcp;
	}

	public String getHolePicture() {
		return holePicture;
	}

	public void setHolePicture(String holePicture) {
		this.holePicture = holePicture;
	}

	public int getHoleState() {
		return holeState;
	}

	public void setHoleState(int holeState) {
		this.holeState = holeState;
	}
	
	public String getHoleDetail() {
		return holeDetail;
	}
	
	public void setHoleDetail(String holeDetail) {
		this.holeDetail = holeDetail;
	}
	
}
